            <style jsx>
                {`
                .heading {
                    color: white;
                    font-family: 'Ubuntu', sans-serif;
                    letter-spacing: -24px;
                    font-size: 300px;
                    font-weight: bold;
                    text-shadow: 6px 6px 0px rgba(0,0,0,0.2);
                    line-height: 0.93em;
                }
            `} 
            </style>
            </div>
        </Layout>
        )
    }
}
